import React from "react";

function App() {
  let count = 0;
  return (
    <div className="App">
      <h1>{count}</h1>
      <button onClick={() => count++}>Increment</button>
      <button onClick={() => count--}>Decremect</button>
    </div>
  );
}

export default App;
